/*! Custom JS */
(function ($) {
    "use strict";

    var hdr = $('.top-banner-container').height();
    $(window).scroll(function() {
        if ($(this).scrollTop() > hdr){
            $('#header .navbar').addClass("navbar-fixed-top");
            //$('#header .navbar').removeClass("animated flipInX");
        }
        else{
            $('#header .navbar').removeClass("navbar-fixed-top");
            //$('#header .navbar').addClass("animated flipInX");
        }
    });
    
    
    $(document).ready(function() {

        // Initiate WOW for animate.css
        new WOW().init();
        
        // dropdown parent click
        var mq = window.matchMedia( "(min-width: 768px)" );
        if (mq.matches) {
            $('.navbar .dropdown > a').click(function(){
                location.href = this.href;
            });
        }

        // Header menu Search button
        $(".search-btn").click(function() {
            //$('.search-container .form-control').css({ 'width' : '250px', 'height' : '35px' });
            $('.search-container .form-control').toggleClass('off on');
            $('.search-container .search-btn span').toggleClass('glyphicon-search glyphicon-remove');
        });

        // Footer Tabs animation
        $("#btn-location").click(function() {
            $( "#explore-location" ).addClass( "animated fadeIn" );
            $( "#explore-location address" ).addClass( "animated slideInUp" );
            $( "#explore-website" ).removeClass( "animated fadeIn" );
            $( "#explore-website ul" ).removeClass( "animated slideInUp" );
        });
        $("#btn-website").click(function() {
            $( "#explore-website" ).addClass( "animated fadeIn" );
            $( "#explore-website ul" ).addClass( "animated slideInUp" );
            $( "#explore-location" ).removeClass( "animated fadeIn" );
            $( "#explore-location address" ).removeClass( "animated slideInUp" );
        });

        $('#dd-category').click(function(){
            $(this).find('i').toggleClass('fa-chevron-down fa-chevron-up');
            $('#dd-search').find('i').removeClass('fa-search-minus');
            $('#dd-search').find('i').addClass('fa-search-plus');
        });
        $('#dd-search').click(function(){
            $(this).find('i').toggleClass('fa-search-plus fa-search-minus');
            $('#dd-category').find('i').removeClass('fa-chevron-up');
            $('#dd-category').find('i').addClass('fa-chevron-down');
        });

    });
})(jQuery);
